window.bookSummaryJSON = "<p>An exciting new urban fantasy series by national best-selling author Devon Monk.&nbsp;&nbsp;</p> <p>Monsters, gods, and mayhem....</p> <p>Police Chief Delaney Reed can handle the Valkyries, werewolves, gill-men, and other paranormal creatures who call the small beach town of Ordinary, Oregon, their home. It’s the vacationing gods who keep her up at night.&nbsp;</p> <p>With the famous rhubarb festival right around the corner, small-town tensions, tempers, and godly tantrums are at an all-time high. The last thing Delaney needs is her ex-boyfriend reappearing just when she's finally caught the attention of Ryder Bailey, the one man she should never love.&nbsp;</p> <p>No, scratch that. The actual last thing she needs is a dead body washing ashore, especially since the dead body is a god.&nbsp;</p> <p>Catching a murderer, wrestling a god power, and rescheduling the apocalypse? Just another day on the job in Ordinary. Falling in love with her childhood friend while trying to keep the secrets of her town secret? That’s going to take some work.</p>"; 
